import React from 'react';
import Navbar from './NavBar'; // Ensure the import path is correctt
import '../styles/Featurepage.css'; // Use this CSS file for both features

const VideoDeepfake = () => {
  return (
    <div>
      <Navbar />
      <div className="feature-content">
        <h1>Video Deepfake Detection</h1>
        <p>Our video deepfake detection tool uses advanced algorithms to identify manipulated videos. Stay ahead in identifying fake videos with our technology.</p>
        {/* Image Section */}
        <img 
          src="https://cdn.prod.website-files.com/61dfc899a471632619dca9dd/62f2dd5573c01a4523b4ace6_Deepfake-Optional-Body-of-Article-p-800.jpeg"  // Replace with the actual image URL or local path
          alt="Video Deepfake Detection"
          style={{ width: '100%', maxHeight: '1000px', objectFit: 'cover', marginBottom: '20px' }}
        />

        {/* Button Section */}
        <a 
          href="http://127.0.0.1:8000/"  // Replace with the actual URL
          style={{ 
            display: 'inline-block', 
            backgroundColor: 'red', 
            color: 'white', 
            padding: '10px 20px', 
            textDecoration: 'none', 
            borderRadius: '5px', 
            fontSize: '16px'
          }}
        >
          Explore More
        </a>
      </div>
    </div>
  );
};

export default VideoDeepfake;
